import PropTypes from 'prop-types'
function Student(props) {
    function checkPropName(name) {
        if (name == "Duc dep trai") {
            return true;
        } else {
            return false;
        }
    }
    return (
        <div>
            <p>Name: {props.name} Age: {props.age}</p>
        </div>
    );
}
Student.propTypes = {
    name: PropTypes.string,
    age: PropTypes.number,
}
